import React, {Component} from 'react';

class Body extends Component{
    state= {
      images: [
          ".././images/Taj_Mahal.jpg",
          "https://images.pexels.com/photos/34950/pexels-photo.jpg",
          "https://images.pexels.com/photos/459225/pexels-photo-459225.jpeg"
      ]
    };
    render() {
        return (
            <div className="_bd-container">
                <div className="_img-container">
                    {this.state.images.map(image => <div className="_img-div" key={image}><img className="_img" src={require(image)} /></div>)}
                </div>
                <div className="_aside-container">
                    <h3>Search flights </h3>
                </div>
            </div>
        );
    }
}

export default Body;
